    "2015-05-07T06:00:20.521408",nt"name": "think-tek-learning-lab-project",nt"isopen":
    true,nt"url": null,nt"notes": "Steven Winter Associates, Inc. (SWA) proposes
    to develop a nation-wide informal technology education program that integrates math,
    science, engineering and technology (STEM) through its Think Tek Learning Lab.  The
    goal of the Lab is three-pronged: providing an after-school enrichment program for
    teens; arousing interest in math and science; and achieving outreach for NASA commercial
    technologies.  The Lab will serve middle/high school students through after-school
    and Saturday classes, summer institutes, and school visits.  The focus of this informal
    technology learning laboratory includes hands-on experimentation and exploration,
    design and construction, and interaction with a variety of technologies, scientists,
    and learning materials.  The Lab will be a living NASA outreach spin-off with experiments
    that showcase real-life NASA commercial technologies.   The project will support
    NASA's efforts to publicize the positive ripple effects that the space funding generates
    on the domestic front.",nt"license_title": "U.S. Government Work",nt"extras":
